                            //     "payload": "EMPLOYER"
                            // },
                            // {
                            //     "type": "postback",
                            //     "title": "Học bổng",
                            //     "payload": "SCHOLARSHIP"
                            // }
                        ]
                    }
                }
            }

            await callSendAPI(sender_psid, response1);
            resolve('done');
        } catch (e) {
            reject(e);
        }
    })
};

let handleHCMCity = (sender_psid) => {
    return new Promise(async (resolve, reject) => {
        try {

            let response1 = askCategory();

            await callSendAPI(sender_psid, response1);
            resolve('done');
        } catch (e) {
            reject(e);
        }
    })
};

let askCategory = () => {
    let response = {
        "attachment": {
            "type": "template",
            "payload": {
                "template_type": "button",
                "text": `Bạn muốn Boo chia sẻ thông tin về chuyên mục gì nhỉ? ^^`,
                "buttons": [
                    {
                        "type": "postback",
                        "title": "Sự kiện",
                        "payload": "EVENT"
                    },
                    {
                        "type": "postback",
                        "title": "Cuộc thi",
                        "payload": "CONTEST"
                    },
                    {
                        "type": "postback",
                        "title": "Tuyển dụng",
                        "payload": "RECRUIT"
                    },
                    // {
