                    //     "payload": "EMPLOYER"
                    // },
                    // {
                    //     "type": "postback",
                    //     "title": "Học bổng",
                    //     "payload": "SCHOLARSHIP"
                    // }
                ]
            }
        }
    };
    return response;
};

module.exports = {
    handleGetStarted: handleGetStarted,
    handleIntro: handleIntro,
    handleHanoiCity: handleHanoiCity,
    handleDanangCity: handleDanangCity,
    handleHCMCity: handleHCMCity
}

